export const ContactConfirm = () => {
  const location = useLocation()
  const history = useHistory()

  // 直接アクセスの場合リダイレクト
  if(location.state === undefined) {
    history.push('/#contact')
  }
  return(
    <h1>Confirmation</h1>

  )
}
